import React from 'react';

import { Form, Input } from 'antd';

const HargaTonaseInput = ({ label, fieldName }) => {
    return (
        <Form.Item label={label}>
            <Form.Item name={fieldName} style={{display: 'inline-block'}}>
                <Input 
                    type="number"
                    prefix="Rp"
                    style={{ width: '100% '}}
                    />
            </Form.Item>
            <Form.Item name={fieldName + "Tonnage"} style={{display: 'inline-block', marginLeft: '8px'}}>
                <Input 
                    type="number"
                    suffix="tons"
                    style={{width: '100%'}}
                    />
            </Form.Item>
        </Form.Item>
    );
};

export default HargaTonaseInput;
